// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/// @title Voting with delegation, timed voting, and tie-handling
contract Ballot {
    struct Voter {
        uint weight;       // weight is accumulated by delegation
        bool voted;        // if true, that person already voted
        address delegate;  // person delegated to
        uint vote;         // index of the voted proposal
    }

    struct Proposal {
        bytes32 name;      // short name (up to 32 bytes)
        uint voteCount;    // number of accumulated votes
    }

    event VoteCast(address indexed voter, uint indexed proposal, uint weight);
    event RightGiven(address indexed chairperson, address indexed voter);
    event Delegated(address indexed from, address indexed to);

    address public chairperson;
    uint public deadline;      // timestamp when voting ends

    mapping(address => Voter) public voters;
    Proposal[] public proposals;

    constructor(bytes32[] memory proposalNames, uint _durationSeconds) {
        chairperson = msg.sender;
        voters[chairperson].weight = 1;

        // voting period = now + _durationSeconds
        deadline = block.timestamp + _durationSeconds;

        for (uint i = 0; i < proposalNames.length; i++) {
            proposals.push(
                Proposal({name: proposalNames[i], voteCount: 0})
            );
        }
    }

    modifier onlyChair() {
        require(msg.sender == chairperson, "Not chairperson");
        _;
    }

    modifier votingActive() {
        require(block.timestamp < deadline, "Voting period has ended");
        _;
    }

    // INTERNAL helper so we can reuse the logic for single & batch
    function _giveRightToVote(address voter) internal {
        require(!voters[voter].voted, "Already voted");
        require(voters[voter].weight == 0, "Already has right");

        voters[voter].weight = 1;

        emit RightGiven(chairperson, voter);
    }

    /// Give `voter` the right to vote on this ballot (single address).
    /// May only be called by `chairperson`.
    function giveRightToVote(address voter) external onlyChair {
        _giveRightToVote(voter);
    }

    /// Batch version: give voting rights to many addresses at once.
    /// Extra feature (not in original example).
    function giveRightToMany(address[] calldata voterAddrs) external onlyChair {
        for (uint i = 0; i < voterAddrs.length; i++) {
            _giveRightToVote(voterAddrs[i]);
        }
    }


    /// Delegate your vote to the voter `to`.
    function delegate(address to) external votingActive {
        Voter storage sender = voters[msg.sender];

        require(sender.weight > 0, "No right to vote");
        require(!sender.voted, "Already voted");
        require(to != msg.sender, "Self-delegation disallowed");

        // Forward the delegation as long as `to` also delegated.
        while (voters[to].delegate != address(0)) {
            to = voters[to].delegate;
            // We found a loop in the delegation, not allowed.
            require(to != msg.sender, "Found delegation loop");
        }

        Voter storage delegate_ = voters[to];

        // Voters cannot delegate to accounts that cannot vote.
        require(delegate_.weight >= 1, "Delegate has no right");

        sender.voted = true;
        sender.delegate = to;

         emit Delegated(msg.sender, to);

        if (delegate_.voted) {
            // If the delegate already voted, add to that proposal
            proposals[delegate_.vote].voteCount += sender.weight;
        } else {
            // If the delegate did not vote yet, add to her weight.
            delegate_.weight += sender.weight;
        }
    }

    /// Give your vote (including votes delegated to you)
    /// to proposal `proposals[proposal].name`.
    function vote(uint proposal) external votingActive {
        Voter storage sender = voters[msg.sender];

        require(sender.weight > 0, "No right to vote");
        require(!sender.voted, "Already voted");
        require(proposal < proposals.length, "Invalid proposal");

        sender.voted = true;
        sender.vote = proposal;
        proposals[proposal].voteCount += sender.weight;

        emit VoteCast(msg.sender, proposal, sender.weight);
    }

    /// Helper: has the voting period ended?
    function hasEnded() external view returns (bool) {
        return block.timestamp >= deadline;
    }

    /// @dev Returns all indices that share the highest voteCount.
    /// If no votes have been cast, returns an empty array.
function getWinners() public view returns (uint[] memory) {
    uint winningVoteCount = 0;
    uint numWinners = 0;

    // First pass: find the highest voteCount and how many have it
    for (uint p = 0; p < proposals.length; p++) {
        uint vc = proposals[p].voteCount;
        if (vc > winningVoteCount) {
            winningVoteCount = vc;
            numWinners = 1;
        } else if (vc == winningVoteCount && vc > 0) {
            numWinners += 1;
        }
    }

    // If nobody has any votes yet, return empty array
    if (winningVoteCount == 0) {
        return new uint[](0);
    }

    // Second pass: collect all proposals that share the max voteCount
    uint[] memory winners = new uint[](numWinners);
    uint idx = 0;
    for (uint p = 0; p < proposals.length; p++) {
        if (proposals[p].voteCount == winningVoteCount) {
            winners[idx] = p;
            idx++;
        }
    }

    return winners;
}


    /// @dev Keeps a single "winningProposal" for backward compatibility.
    /// If there is a tie, this just returns the first winner index.
    function winningProposal() public view returns (uint winner) {
        uint[] memory winners = getWinners();
        if (winners.length == 0) {
            // No votes cast yet -> default to index 0
            return 0;
        }
        return winners[0];
    }

    /// @dev Returns the name of one winning proposal (first one if tie).
    function winnerName() external view returns (bytes32) {
        uint[] memory winners = getWinners();
        if (winners.length == 0) {
            // No votes yet: return first proposal's name as a fallback
            return proposals[0].name;
        }
        return proposals[winners[0]].name;
    }
}
